var CryptoJS = require('crypto-js');
var md5 = require('md5-node');

var l = "0a1fea31626b3b55";


function f(e, l) {
    e = CryptoJS.enc.Utf8.parse(e);
    l = CryptoJS.enc.Utf8.parse(l);
    return CryptoJS.AES.encrypt(l, e, {
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7,
        iv: e
    }).toString()

}

function k(e) {
    var l = md5("www.maomaozu.com".replace(/\./g, "_"));
    return l = 0 == e ? l.substring(0, 16) : l.substring(16, 32)
}

function d(e, l) {
    e = CryptoJS.enc.Utf8.parse(e);
    var a = CryptoJS.AES.decrypt(l, e, {
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7,
        iv: e
    });
    return CryptoJS.enc.Utf8.stringify(a).toString()
}

function aes_encrypt(e) {
    return f(k(0), e)
}

function aes_decrypt(e) {
    return d(l, e)
}

function my_encrypt(l) {
    data = aes_encrypt(JSON.stringify(l));
    // console.log(data)
    return data
}

function my_decrypt(e) {
    data = aes_decrypt(e.replace(/^\s+|\s+$/gm, ""));
    // console.log(e)
    return data
}

